module.exports=StatisticsPacket;function StatisticsPacket(){this.message=undefined}StatisticsPacket.prototype.parse=function(d){this.message=d.parsePacketTerminatedString();var b=this.message.split(/\s\s/);for(var c=0;c<b.length;c++){var a=b[c].match(/^(.+)\:\s+(.+)$/);if(a!==null){this[a[1].toLowerCase().replace(/\s/g,"_")]=Number(a[2])}}};StatisticsPacket.prototype.write=function(a){a.writeString(this.message)};